import './App.css';

function App() {
  return (
    <div className="App">
     <div>
      <label>rom</label>
      <input type="date"></input>
     </div>
      <div>
      <label>to</label>
      <input type="date"></input>
     </div>
     <div>
      <button>submit</button>
     </div>
    </div>
  );
}

export default App;
